var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': '每周進度', 'text': '', 'tags': '', 'url': '每周進度.html'}, {'title': 'Week1', 'text': '創建cd2020的倉儲 \n 創建個人網站 \n 步驟: \n 1.登入github帳號 \n 2.創建新的倉儲，名稱為cd2020 \n 3.接著git clone\xa0 https://github.com/s40723149/cd2020 \xa0 \n 4.執行git submodule add\xa0 https://github.com/mdecourse/cmsimde.git \xa0 \n 5.將cmsimde>up_dir裡的所有項目複製到外面的cd2020資料夾裡面 \n 6.cd cmsimde 輸入python -m pip install flask_cors 更改模組 \n 7.接著就能執行python wsgi.py \n 8.編輯完之後轉為靜態網站，將自己每周的進度記錄在裡面 \n', 'tags': '', 'url': 'Week1.html'}, {'title': 'Week2', 'text': '組長分配工作流程表 \n \n', 'tags': '', 'url': 'Week2.html'}, {'title': 'week3', 'text': '開始執行分組工作 個人分配到的是python編程系統更新 \n', 'tags': '', 'url': 'week3.html'}, {'title': '更新Python 3.8.2', 'text': '1.進入\xa0 https://www.python.org/downloads/release/python-382/ \n 2. 下載 Windows x86-64 executable installer \n 3.下載完成後開啟，選擇Customize installation(訂製化安裝)選項 \n \n 4.不要勾選pip選項，接著按下next \n \n 5.選擇路徑將python安裝至可攜式系統中的Y槽下 \n 6.接著開啟start_mdecourse.bat批次檔 \n 7.將 start_mdecourse.bat批次檔中的py373改為安裝python 3.8.2版本的資料夾 \n 8.將安裝的版本資料夾取名為py382 \n \n 8.執行stop.bat批次檔後重新啟動start_mdecourse(為了讓檔案重新讀取) \n 9.輸入get-pip.py，開始安裝pip工具 \n 10.安裝cmsimde所需模組 \n \n 11.檢查版本是否更新至\xa0 python 3.8.2 \n \n', 'tags': '', 'url': '更新Python 3.8.2.html'}, {'title': 'week5', 'text': '', 'tags': '', 'url': 'week5.html'}, {'title': '直播內容', 'text': '\n', 'tags': '', 'url': '直播內容.html'}, {'title': 'Webots tutorial 內容翻譯', 'text': '\n', 'tags': '', 'url': 'Webots tutorial 內容翻譯.html'}, {'title': '常見問題', 'text': '教材來源: https://cyberbotics.com/doc/guide/general-faq \n 一般常見問題 \n Webots真的是免費而且開源的軟體嗎? \n 是的! 從R2019a版本開始，Webots完全免費且開源。 它仍在積極發展中。 源代碼可從GitHub獲得，並根據Apache 2許可條款發布。 \n Cyberbotics與多個學術和工業項目合作，並為需要快速開發高質量Webots模擬的用戶提供有償用戶支持，培訓和諮詢。 請與我們聯繫以獲取有關我們服務的更多信息。 \n 我還可以使用R2019a之前的版本嗎? \n 是的，免費！ 但是請升級Webots！ \n 從 此存檔頁面 下載舊的Webots版本。只需使用以下神奇密碼登錄Webots: webots 。 您的電子郵件沒有關係（它不會存儲在任何地方）。 \n 限制 \n \n 該許可證系統仍可用於以下版本：Webots 7、8和R2018。 \n 版本大於等於8.0和小於8.4的Webot不再起作用。 \n \n 要從哪裡開始? \n 下載Webots ， 安裝 並遵循 官方教程 。 \n', 'tags': '', 'url': '常見問題.html'}, {'title': '程式設計', 'text': '教材來源: https://cyberbotics.com/doc/guide/programming', 'tags': '', 'url': '程式設計.html'}]};